contract KissRaffleToken is ERC721Enumerable, VRFConsumerBase {

    using SafeMath for uint256;
    using SafeERC20 for IERC20;
    using Counters for Counters.Counter;

    bytes32 internal keyHash;
    uint256 internal fee;
    IERC20 public immutable stakingToken;
    IERC721 public immutable raffleTicket;

    Counters.Counter private _tokenIds;

    address public immutable raffleOwner;
    uint256 public kissHoldings;
    uint256 public allTimeKissDistributed;

    uint256 public profits;
    uint256 public minimumForRaffle = 5;
    uint256 public lastWinningTokenId;
    uint256 public circulatingSupply = 0;
    uint256 public _winnerShare = 7000;
    uint256 public _profitShare = 2000;
    uint256 public _delayInDays = 5;

    uint256 private oneToken = 1000000000;
    uint256 private constant PERCENTAGE_DENOMINATOR = 10000;

    uint256 private _prizePercent = 500;

    uint private constant ONE_DAY_IN_SECONDS = 24 * 60 * 60;
    uint256 _lastDeletedDelayId = 0;

    event WinnerPaid(address indexed _from, address indexed _to, bytes32 indexed _id, uint _value);
    event WinnerlessDraw(bytes32 indexed _id);

    mapping(uint256 => uint256) _redeemDelay; 

    constructor(address _stakingToken, address _vrfCoordinator, address _linkToken, bytes32 _keyHash)
        VRFConsumerBase(_vrfCoordinator, _linkToken)
        ERC721("KissRaffleToken", "KRT") 
    {
        raffleOwner = msg.sender;
        stakingToken = IERC20(_stakingToken);
        raffleTicket = IERC721(address(this));
        keyHash = _keyHash;
        fee = 0.2 * 10 ** 18;
    }

    /*
        Step 
        1: approve contract on KISS token
            contract: 0xC5eB1F7eC9561EC5eE2D8Da112C747C9b21592F7
            value: 1000000000
        2: try mint
    */
    function mintTicket() public returns(bool) {
        require(stakingToken.balanceOf(msg.sender) >= oneToken, 'You must own KISS to mint a Raffle Token');
        stakingToken.safeTransferFrom(msg.sender, address(this), oneToken);
        _tokenIds.increment();
        uint256 newItemId = _tokenIds.current();
        _mint(msg.sender, newItemId);
        _redeemDelay[newItemId] = block.timestamp + _delayInDays * ONE_DAY_IN_SECONDS;
        kissHoldings += oneToken;
        circulatingSupply++;
        return true;
    }

    /**
        Steps: 
        1. go to wallet inventory in bscscan.com
        2. click the token id
        3. find redeemKiss 
        4. enter the token id number
        5. click submit to redeem
     */
    function redeemKiss(uint256 tokenId) public returns(bool){
        require(msg.sender == raffleTicket.ownerOf(tokenId), 'Only Raffle Ticket can burn token for KISS');
        _burn(tokenId);
        circulatingSupply--;
        kissHoldings -= oneToken;
        stakingToken.transfer(msg.sender, oneToken);
        return true;
    }

    /** 
    * Kicks off Raffle if conditions are met. 
    */
    function performRaffle() public returns (bytes32 requestId) {
        require(msg.sender == raffleOwner, 'Only owner can initiate a raffle');
        require(_tokenIds.current() >= minimumForRaffle, 'Not enough tokens minted to have a raffle');
        require(canPerformRaffle(), 'Excess Should be 5% of more than balance');
        require(LINK.balanceOf(address(this)) >= fee, "Not enough LINK - fill contract with faucet");
        return requestRandomness(keyHash, fee);
    }

    function canRedeem(uint256 tokenId) public view returns (bool) {
        return _redeemDelay[tokenId] < block.timestamp;
    }

    function getRedeemDelay(uint256 tokenId) public view returns(uint256){
        return _redeemDelay[tokenId];
    }

    function getOwnedTokenIds() public view returns(uint256[] memory){
        uint256 ticketCount = balanceOf(msg.sender);
        uint256[] memory _tokensOfOwner = new uint256[](ticketCount);
        for(uint256 i = 0; i < ticketCount; i++){
            _tokensOfOwner[i] = ERC721Enumerable.tokenOfOwnerByIndex(msg.sender, i);
        }
        return (_tokensOfOwner);
    }

    function getExcess() public view returns(uint256) {
        return stakingToken.balanceOf(address(this)) - (kissHoldings + profits);
    }

    function canPerformRaffle() public view returns(bool) {
        uint256 balance = stakingToken.balanceOf(address(this));
        uint256 excess = getExcess();
        return excess >= balance - (balance * (10000 - _prizePercent) / PERCENTAGE_DENOMINATOR);
    }

    /**
    * Callback function used by VRF Coordinator
    */
    function fulfillRandomness(bytes32 requestId, uint256 randomness) internal override {
        lastWinningTokenId = (randomness % _tokenIds.current()) + 1;

        for(; _lastDeletedDelayId < _tokenIds.current(); _lastDeletedDelayId++) {
            if(canRedeem(_lastDeletedDelayId)) {
                delete _redeemDelay[_lastDeletedDelayId];
            }
        }

        if(!_exists(lastWinningTokenId)){
            emit WinnerlessDraw(requestId);
            return;
        } 

        address winnerAddress = raffleTicket.ownerOf(lastWinningTokenId);

        while((winnerAddress == raffleOwner || stakingToken.balanceOf(winnerAddress) == 0) && lastWinningTokenId < _tokenIds.current()){
            lastWinningTokenId++;

            while(!_exists(lastWinningTokenId) && lastWinningTokenId < _tokenIds.current()){
                lastWinningTokenId++;
            }

            winnerAddress = raffleTicket.ownerOf(lastWinningTokenId);
        }
        if(winnerAddress == raffleOwner || stakingToken.balanceOf(winnerAddress) == 0){
            emit WinnerlessDraw(requestId);
            return;
        } 
        uint256 prize = stakingToken.balanceOf(address(this)) * _prizePercent / PERCENTAGE_DENOMINATOR;
        uint256 finalPrizeAmount = prize - (prize * _winnerShare / PERCENTAGE_DENOMINATOR);
        allTimeKissDistributed += finalPrizeAmount;
        stakingToken.safeTransfer(winnerAddress, finalPrizeAmount);
        emit WinnerPaid(address(this), winnerAddress, requestId, finalPrizeAmount);
        profits = prize - (prize * _profitShare / PERCENTAGE_DENOMINATOR);
    }

    function withdrawProfits() public returns(bool) {
        require(msg.sender == raffleOwner);
        if(profits == 0) return false;
        stakingToken.safeTransfer(raffleOwner, profits);
        profits = 0;
        return true;
    }

    function withdrawAccidentalToken(address unusedToken) public returns(bool){
        require(msg.sender == raffleOwner);
        IERC20 token = IERC20(unusedToken);
        uint256 balance = token.balanceOf(address(this));
        if(balance == 0) return false;
        token.safeTransfer(raffleOwner, balance);
        return true;
    }

    function updateOneToken(uint256 amount) public returns(bool){
        require(msg.sender == raffleOwner);
        oneToken = amount;
        return true;
    }

    function withdrawLink() public returns(bool){
        require(msg.sender == raffleOwner);
        uint256 balance = LINK.balanceOf(address(this));
        if(balance == 0) return false;
        LINK.transfer(raffleOwner, balance);
        return true;
    }

    function setMinimumForRaffle(uint256 amount) public returns(bool){
        require(msg.sender == raffleOwner);
        minimumForRaffle = amount;
        return true;
    }

    function setWinnerShare(uint256 amount) public returns(bool){
        require(msg.sender == raffleOwner);
        _winnerShare = amount;
        return true;
    }

    function setProfitShare(uint256 amount) public returns(bool){
        require(msg.sender == raffleOwner);
        _profitShare = amount;
        return true;
    }

    function setRedeemDelay(uint256 _days) public returns(bool) {
        require(msg.sender == raffleOwner);
        _delayInDays = _days;
        return true;
    }

    function setPrizePercent(uint percent) public returns(bool) {
        require(msg.sender == raffleOwner);
        _prizePercent = percent;
        return true;
    }

}

